  false,\n\t\"url\": null,\n\t\"notes\": \" This feature class is part of the Cadastral
  National Spatial Datan                Infrastructure (NSDI) CADNSDI publication
  data set for rectangular andn                non-rectangular Public Land Survey
  System (PLSS) data set. The metadata descriptionn                in the Cadastral
  Reference System Feature Data Set more fully describes the entiren                data
  set. This feature class is the second division of the PLSS is quarter,n                quarter-quarter,
  sixteenth or government lot divisions of the PLSS. The second andn                third
  divisions are combined into this feature class as an intentionaln                de-normalization
  of the PLSS hierarchical data. The polygons in this feature classn                represent
  the smallest division to the sixteenth that has been defined for the firstn                division.
  For example In some cases sections have only been divided to the quarter.n                Divisions
  below the sixteenth are in the Special Survey or Parcel Feature Class. \",\n\t\"owner_org\":
